import "./App.css";

function App() {
  return (
    <div className="app">
      <div className="bg">
        <img className="upbeaticon" src="/images/upbeaticon.png" />
        <div className="headtext">UPBEAT</div>
      </div>
    </div>
  );
}

export default App;
